import React from 'react';
import {
  View,
  Text,
  TouchableOpacity,
  ScrollView,
  SafeAreaView,
  Alert,
} from 'react-native';
import { Ionicons } from '@expo/vector-icons';
import { styles } from '../styles-part/SafeMitraReadyScreenStyles';
import SafeMitraLogo from '../../components/SafeMitraLogo';

const SafeMitraReadyScreen = ({ navigation }) => {
  const handleOpenDashboard = () => {
    // Navigate to dashboard
    navigation.navigate('Dashboard');
  };

  const handleRunSilently = () => {
    Alert.alert(
      'Running in Background',
      'SafeMitra will now run silently in the background. You can reopen the app anytime from your app tray.',
      [
        {
          text: 'OK',
          onPress: () => {
            // Implement background service activation here
            // For now, just go back
            navigation.goBack();
          }
        }
      ]
    );
  };

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView contentContainerStyle={styles.scrollContainer}>
        <View style={styles.header}>
          <TouchableOpacity
            style={styles.backButton}
            onPress={() => navigation.goBack()}
          >
            <Ionicons name="arrow-back" size={24} color="#FF3B30" />
          </TouchableOpacity>
          <View style={styles.logoContainer}>
            <SafeMitraLogo color="#FF3B30" size={30} />
            <Text style={styles.logoText}>SafeMitra</Text>
          </View>
        </View>

        <View style={styles.contentContainer}>
          <View style={styles.iconContainer}>
            <Ionicons name="shield-checkmark" size={50} color="#FFFFFF" />
          </View>

          <Text style={styles.title}>SafeMitra is All Set!</Text>

          <Text style={styles.subtitle}>
            Your voice is trained, guardians are added, and your secret code is secured.{'\n\n'}
            SafeMitra will now run silently in the background, always ready to protect you.
          </Text>

          <View style={styles.featureList}>
            <View style={styles.featureItem}>
              <Ionicons name="checkmark-circle" size={20} color="#FF3B30" />
              <Text style={styles.featureText}>Voice Hotword Trained</Text>
            </View>
            <View style={styles.featureItem}>
              <Ionicons name="checkmark-circle" size={20} color="#FF3B30" />
              <Text style={styles.featureText}>Guardians Connected</Text>
            </View>
            <View style={styles.featureItem}>
              <Ionicons name="checkmark-circle" size={20} color="#FF3B30" />
              <Text style={styles.featureText}>Secret Code Locked</Text>
            </View>
          </View>

          <View style={styles.infoBox}>
            <Text style={styles.infoText}>
              Note: SafeMitra does not require the internet to function.{'\n'}
              Your safety features are active even in offline mode.
            </Text>
          </View>

          <View style={styles.buttonContainer}>
            <TouchableOpacity
              style={styles.primaryButton}
              onPress={handleOpenDashboard}
            >
              <Text style={styles.primaryButtonText}>Open Dashboard</Text>
            </TouchableOpacity>

            <TouchableOpacity
              style={styles.secondaryButton}
              onPress={handleRunSilently}
            >
              <Text style={styles.secondaryButtonText}>Run Silently</Text>
            </TouchableOpacity>
          </View>

          <Text style={styles.navigationTip}>
            You can always reopen SafeMitra from your app tray.
          </Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

export default SafeMitraReadyScreen;
